import React from "react";

function TopNavBar() {
    return <div className="topNavBar">
        <a href="#file"><div className="topBarText">File</div></a>
        <a href="#home">Home</a>
        <a href="insert">Insert</a>
        <a href="#draw">Draw</a>
        <a href="#view">View</a>
        <a href="#help">Help</a>
    </div>;
}

export default TopNavBar;
